import './App.css';
import Intro from './components/Intro';
import Aboutme from './components/Aboutme'
import Projects from './components/Projects'
import Contact from './components/Contact'


function App() {
  return (
    <div>
      <Intro />
      <Aboutme />
      <Projects />
      <Contact />
    </div>
  );
}

export default App;
